INSERT INTO `faqs` (`id`, `category`, `question`, `question_en`, `answer`, `answer_en`, `view_count`, `sort_order`, `is_active`, `created_at`) VALUES
(1, '일반', '견적은 어떻게 요청하나요?', 'How can I request a quote?', '홈페이지의 \"Request a Quote\" 메뉴를 통해 요청하시거나, 대표전화로 문의주시면 신속하게 견적을 제공해드립니다.', 'You can request a quote through the \"Request a Quote\" menu on our website or contact us via our main phone number for a quick quote.', 0, 1, 1, '2025-06-19 00:37:21'),
(2, '운송', '항공운송과 해상운송의 차이점은 무엇인가요?', 'What is the difference between air and sea freight?', '항공운송은 빠르지만 비용이 높고, 해상운송은 시간이 오래 걸리지만 대량 화물에 경제적입니다.', 'Air freight is faster but more expensive, while sea freight takes longer but is more economical for large volumes.', 0, 2, 1, '2025-06-19 00:37:21'),
(3, '통관', '통관에 필요한 서류는 무엇인가요?', 'What documents are required for customs clearance?', '상업송장, 포장명세서, 원산지증명서 등이 기본적으로 필요하며, 품목에 따라 추가 서류가 요구될 수 있습니다.', 'Commercial invoice, packing list, and certificate of origin are basically required. Additional documents may be required depending on the items.', 0, 3, 1, '2025-06-19 00:37:21'),
(4, '창고', '창고 보관 서비스도 제공하나요?', 'Do you provide warehouse storage services?', '네, 전국 주요 거점에 창고를 보유하고 있으며, 장단기 보관 서비스를 제공합니다.', 'Yes, we have warehouses at major locations nationwide and provide short and long-term storage services.', 0, 4, 1, '2025-06-19 00:37:21'),
(5, '기타', '화물 추적은 어떻게 하나요?', 'How can I track my shipment?', '고객님께 제공된 추적번호로 홈페이지에서 실시간 조회가 가능합니다.', 'You can track your shipment in real-time on our website using the tracking number provided to you.', 0, 5, 1, '2025-06-19 00:37:21');
