INSERT INTO `news_posts` (`id`, `title`, `title_en`, `content`, `content_en`, `excerpt`, `author`, `category`, `status`, `view_count`, `created_at`, `updated_at`, `published_at`, `is_featured`, `meta_title`, `meta_description`, `meta_keywords`) VALUES
(1, 'Scheduled System Maintenance Notification', NULL, 'Dear Team,\nPlease be informed that a scheduled system maintenance will take place as follows:\n\nDate: Tuesday, July 1, 2025\n\nTime: 10:00 PM - 2:00 AM (next day)\n\nPurpose: Server inspection and security updates\n\nImpact: Limited access to some services during maintenance\n\nWe apologize for any inconvenience this may cause.\nThank you for your understanding.\n\nSincerely,\nIT Management Team', NULL, NULL, 'IT Management Team', 'logistics', 'published', 4431, '2025-06-24 10:35:17', '2025-11-19 18:48:47', '2025-01-03 00:00:00', 0, NULL, NULL, NULL),
(2, 'New Warehouse Opening in Dallas', NULL, 'We are excited to announce the opening of our new state-of-the-art warehouse facility in Dallas, Texas. This expansion will enhance our logistics capabilities in the Southwest region.\n\nKey Features:\n- 50,000 square feet of storage space\n- Advanced inventory management system\n- Temperature-controlled zones\n- 24/7 security monitoring\n\nThe facility will be fully operational starting February 1, 2025.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 1538, '2025-06-24 10:35:17', '2025-11-19 18:48:46', '2025-01-02 05:30:00', 0, NULL, NULL, NULL),
(3, 'Holiday Schedule Notice', NULL, 'Please note our holiday schedule for the upcoming season:\n\nChristmas Eve (Dec 24): Offices close at 12:00 PM\nChristmas Day (Dec 25): All offices closed\nNew Year\'s Eve (Dec 31): Offices close at 3:00 PM\nNew Year\'s Day (Jan 1): All offices closed\n\nRegular business hours will resume on January 2, 2025.\n\nHappy Holidays from the IMPEX GLS team!', NULL, NULL, 'IT Management Team', 'logistics', 'published', 566, '2025-06-24 10:35:17', '2025-11-19 18:21:23', '2024-12-20 01:00:00', 0, NULL, NULL, NULL),
(4, 'Air Freight Service Enhancement', NULL, 'IMPEX GLS is pleased to announce enhanced air freight services between USA and Asia. \n\nNew features include:\n- Daily flights to major Asian hubs\n- Reduced transit times by 20%\n- Real-time tracking updates\n- Competitive pricing structure\n\nContact your account manager for more details.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 581, '2025-06-24 10:35:17', '2025-11-19 18:21:27', '2024-12-15 02:00:00', 0, NULL, NULL, NULL),
(5, 'System Update Complete', NULL, 'The scheduled system update has been successfully completed. All services are now fully operational with improved performance and security features.\n\nThank you for your patience during the maintenance period.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 528, '2025-06-24 10:35:17', '2025-11-19 18:21:29', '2024-12-09 23:00:00', 0, NULL, NULL, NULL),
(6, 'New Customer Portal Launch', NULL, 'We are thrilled to introduce our new customer portal with enhanced features:\n\n- Intuitive dashboard\n- Advanced shipment tracking\n- Document management\n- Online quote requests\n- Invoice history\n\nAccess the portal at portal.impexgls.com', NULL, NULL, 'IT Management Team', 'logistics', 'published', 540, '2025-06-24 10:35:17', '2025-11-19 18:21:32', '2024-12-05 04:00:00', 0, NULL, NULL, NULL),
(7, 'Warehouse Safety Training', NULL, 'Mandatory safety training sessions will be conducted for all warehouse staff:\n\nChicago: December 8-9\nLos Angeles: December 11-12\nNew York: December 14-15\n\nPlease coordinate with your supervisor for scheduling.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 508, '2025-06-24 10:35:17', '2025-11-19 18:21:35', '2024-12-01 00:30:00', 0, NULL, NULL, NULL),
(8, 'Service Disruption Alert', NULL, 'Due to severe weather conditions, there may be delays in deliveries to the Northeast region. Our team is working diligently to minimize impact.\n\nAffected areas: NY, NJ, CT, MA\nExpected resolution: Within 48 hours\n\nWe apologize for any inconvenience.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 512, '2025-06-24 10:35:17', '2025-11-20 01:49:02', '2024-11-28 07:00:00', 0, NULL, NULL, NULL),
(9, 'Year-End Inventory Notice', NULL, 'Annual inventory count will be conducted at all facilities from December 28-30. During this period, shipping and receiving operations may experience minor delays.\n\nPlease plan your shipments accordingly.', NULL, NULL, 'IT Management Team', 'logistics', 'published', 524, '2025-06-24 10:35:17', '2025-11-19 18:21:40', '2024-11-25 01:00:00', 0, NULL, NULL, NULL);
